      "text": "Kaisers ist die Bewohnung auf dem ersten Stock zu verlethen, bestehend in 3 Studen, Kuchin, Rammmern, Sommerhaus, Keller c. nach Belieben zu beziehen."
    },
    {
      "date": "1783-10-04",
      "tags_section": "hingegen wird zu kaufen begehrt:",
      "text": "1. Es sucht jemand einen sibern Schreibzeug mit aller Zugehördt und schöner Kason, der Liebhaber ist im Berichthaus zu erfragen."
    },
    {
      "date": "1783-10-04",
      "tags_section": "hingegen wird zu kaufen begehrt:",
      "text": "2. Man begehrt eine Chais mit 4 Rädern zu et. wann, 3 Plätzen und zu einem Pferd samt ge hörigem Geschirr, der Liebhaber ist im Be richtshaus ohne Entgeldt zu erfragen."
    },
    {
      "date": "1783-10-04",
      "tags_section": "hingegen wird zu kaufen begehrt:",
      "text": "3. Wer hier oder auf dem Land noch neuen Trau ber - Brandewein Ohmenweis zu verkaufen hat, kan im Berichthaus einen Käufer darzu vernehmen, wie auch zu einem mittelmässigen, so ebenfalls begehrt wird, beydes ohne Entgeldt im Berichthaus ist zu erfragen."
    },
    {
      "date": "1783-10-04",
      "tags_section": "hingegen wird zu kaufen begehrt:",
      "text": "4. Es sucht jemand eine gute, solide und unge fehr einen Saum haltende Feuerspritzen zum tragen oder zum führen, der Liebhaber ist im Berichthaus zu erfragen."
    },
    {
      "date": "1783-10-04",
      "tags_section": "hingegen wird zu kaufen begehrt:",
      "text": "5. Es sucht jemand einen mösingenen Kron Leuchter mit 8 Lichtstöcken, der Liebhaber ist im Berichthaus zu erfragen."
    },
    {
      "date": "1783-10-04",
      "tags_section": "hingegen wird zu kaufen begehrt:",
      "text": "6. Es verlangt jemand eine nicht gar grosse el ferne Geldkasse zu kaufen, der Liebhaber ist im Berichthaus zu erfragen."
    },
    {
      "date": "1783-10-04",
      "tags_section": "hingegen wird zu kaufen begehrt:",
      "text": "7. Es verlangt jemand einen glatten nußbaumern pwedthürigen Kasten, der Liebhaber ist im Be richtshaus zu erfragen."
    },
    {
      "date": "1783-10-04",
      "tags_section": "hingegen wird zu kaufen begehrt:",
      "text": "8. Man verlangt einen noch guten Rache - Ofen mittelmässiger Grofse mit oder ohne Fuß, der Liebhaber ist im Berichthaus zu erfragen; lei bet aber keinen Verzug."
    },
    {
      "date": "1783-10-04",
      "tags_section": "hingegen wird zu kaufen begehrt:",
      "text": "3. Ein Losament mit einem schönen Laden und Laden - Stüblein nebst einem grossen Sommers haus, Studen, Kuchin, 2 grosse Kammern, einem besondern Keller, Holzhaus, ein bechloß senes Bauchhaus, auf der Eisengaß, im Be richtshaus zu erfragen."
    },
    {
      "date": "1783-10-04",
      "tags_section": "hingegen wird zu kaufen begehrt:",
      "text": "4. Ein Losament in der Frischgaß von einer Stu ben, Kammern und Plaz zum Holz, auf Pfingst - Fromkasten zu beziehen, im Berichthaus zu erfragen."
    },
    {
      "date": "1783-10-04",
      "tags_section": "hingegen wird zu kaufen begehrt:",
      "text": "5. Ein Losament für 2 Personen in der Weissen Gaß, bestehend aus einem Stüblein und Alle kosen, Plaz zum Hausrath zu stellen, auf eis nem Boden, wie auch Plaz zum Holz, Bruns nen un ein Haus, a 15 Pfund Zins des Jahrs, kan gleich bezogen werden, im Berichthaus zu erfragen."
    },
    {
      "date": "1783-10-04",
      "tags_section": "hingegen wird zu kaufen begehrt:",
      "text": "6. Ein schönes Losament ebnes Fusses auf eis nem Boden von 2 Studen, einem grossen Saal, Kammern, Kuchin, Keller, Plaz zum Holz, Zutritt zum Bauchhaus, und so belie big, einem Garten in der Aeschmer Vorstadt, im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": "1783-10-04",
      "tags_section": "hingegen wird zu kaufen begehrt:",
      "text": "7. Eine grosse doppelte Frucht - Schütte auf E. E. Gesellschaft zum hohen Kauf."
    },
    {
      "date": "1783-10-04",
      "tags_section": "hingegen wird zu kaufen begehrt:",
      "text": "8. Bis den 1sten dis ist wird eine säugende Hündin begehrt, um etliche junge Hunde zu aufersie hen, gegen einer Erkentlichkeit; wo sich anzu melden, ist im Berichthaus ohne Entgeldt zu vernehmen."
    },
    {
      "date": "1783-10-04",
      "tags_section": "hingegen wird zu kaufen begehrt:",
      "text": "9. Auf künftige Weyhnacht ist unter der St. Bes ters - Schul ein geräumiges Magazin zu verlei hen, darum sich in dem Schulhaus anzu melden."
    },
    {
      "date": "1783-10-04",
      "tags_section": "Kost, Information und Bedienun gen werden angetragen und begehrt:",
      "text": "1. In ein wackeres protestantisches Haus in denen Niederlanden wird ein Candidatus Theologiæ, der neben andern auch die französische Sprach verstände, zu einem Haus - Präceptor begehrt, weshalb sich im Berichthaus zu melden."
    },
    {
      "date": "1783-10-04",
      "tags_section": "Kost, Information und Bedienun gen werden angetragen und begehrt:",
      "text": "2. Man verlangt einen Menschen in eine Fabri ke, der sich zu allerlei haus Geschäften brau chen liesse, im Berichthaus zu erfragen."
    },
    {
      "date": "1783-10-04",
      "tags_section": "Kost, Information und Bedienun gen werden angetragen und begehrt:",
      "text": "3. Man sucht einen Stallknecht in ein Wirths haus, im Berichthaus zu erfragen."
    },
    {
      "date": "1783-10-04",
      "tags_section": "Es wird zum Ausleihen offeriert:",
      "text": "1. Ein Losament mitten im Offenburger - Hof, wie der Augenschein zeigen wird, auf nächste Pfingst - Fronfasten oder Pfingst - Fronfasten zu beziehen."
    },
    {
      "date": "1783-10-04",
      "tags_section": "Es wird zum Ausleihen offeriert:",
      "text": "2. Ein sauberes Losament auf der Spalen von eis nen Studen und Redekammer, oder nach Belieben zwo Kammern samt einem heitern Sommerhaus, alles auf einem Boden, und nach Belieben Stallung und Heubühne, auf Pfingst - Fronfasten zu beziehen."
    },
    {
      "date": "1783-10-04",
      "tags_section": "Kost, Information und Bedienun gen werden angetragen und begehrt:",
      "text": "4. Ein"
    }
  ]
}

